                  style={{
                    flexDirection: "row",
                    alignItems: "center",
                    justifyContent: "space-between",
                    width: "65%",
                  }}
                >
                  <TouchableOpacity style={styles.group5} onPress={logout}>
                    <Text style={styles.monthly6}>Cancel</Text>
                  </TouchableOpacity>
                  <TouchableOpacity
                    style={styles.group5}
                    onPress={() => setstageNum((prev) => prev + 1)}
